text_show:
Nattesøvnen er utrolig vigtig for det lille barn. Søvnen er med til at give udviklingen og sundheden optimale betingelser for barnet. Det er derfor vigtigt at skabe tryghed og gode hyggelige traditioner når barnet skal puttes. Putteritualet er et helt kapitel for sig og er med til at give en god afslutning på dagen og en god indgang til natten.
Når barnet efter endt putteseance forlades, er det vigtigt at stemningen stadig bevares. Derfor kan en natlampe være med til at opretholde trygheden og den gode stemning. Det kan både være en lille vågelampe som den med månemotivet som du finder her eller en af de flotte lamper fra Cloud B som skaber en fantastisk flot stjernehimmel. Natlamperne Twilight Buddies bamse og Twilight Buddies giraf kan samtidig fungere som sovedyr og bruges om dagen til at lege med. Natlamperne med dyr er rigtigt fine at have stående på børneværelset og pynte også om dagen. Har du set den anderledes natlampe fra Haba, som danner grafiske motiver på væggen og loftet. Litecup er en spildfri kop med lys i så den er til at finde for barnet om natten.
